import axios from 'axios';
import Board from '@lourenci/react-kanban'

class Boarding extends Component {
    constructor(props) {
      super(props);

    }
    render() {
        const board = {
            lanes: [
              {
                id: 1,
                title: 'Backlog',
                cards: [
                  {
                    id: 1,
                    title: 'Add card',
                    description: 'Add capability to add a card in a lane'
                  },
                ]
              },
              {
                id: 2,
                title: 'Doing',
                cards: [
                  {
                    id: 2,
                    title: 'Drag-n-drop support',
                    description: 'Move a card between the lanes'
                  },
                ]
              }
            ]
          }
        return(<div>
            <Board>{board}</Board>
        </div>)
    }
    onDrop(data) {
        console.log(this)
    }
  }

export default (withRouter)(Boarding)
